	(100, '2024-11-28 14:38:16.759599', '2024-11-28 14:38:16.759599', 'Hộp Macaron này bao gồm các hương vị sau:\n\nTrắng với đường xoáy màu cam - Ganache vani và sô cô la trắng \n\nTím với bụi vàng - Nhân quả lý chua đen\n\nMàu cam đậm với những vòng xoáy màu cam và đỏ - Nhân caramel mặn \n\nNâu nhạt với xoáy nâu - Ganache cà phê', '17x15x5', '1732779496309-MD_2022_macron_box_01_350x.webp', 'https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lsx22xwbjp218d', '08a91251-087a-410f-a2f4-2e48bdd1770c', 'Hộp Macaron Le Grande 20 chiếc', '5fd17d29-aae2-11ef-9809-b46d832b8170', '8f3ea340-4231-4332-8679-1c8ee17b99bb'),
	(200, '2024-11-27 14:58:25.313349', '2024-11-27 14:58:25.313349', 'Indulge in the divine flavor of our Fudgy Brownie Cookies, where gooey brownie centers meet chewy cookie edges. This recipe is a chocolate lover’s dream, offering the ultimate treat for those craving the perfect blend of brownie and cookie.', '10x10x10', '1732694304242-oreocookies.jpg', 'https://bromabakery.com/wp-content/uploads/2021/03/peanut-butter-oreo-truffles-8-1067x1600.jpg', '0c7f0970-76be-4986-a8f2-055f165281f4', 'Oreo Cookie', '717587b8-77eb-4880-bffe-c9a7a6801dd6', '8f3ea340-4231-4332-8679-1c8ee17b99bb'),
	(100, '2024-11-28 14:13:50.153756', '2024-11-28 14:13:50.153756', 'Những viên sôcôla sang trọng của chúng tôi là một món quà chu đáo cho các ngày kỷ niệm, sinh nhật, quà tặng cho giáo viên hoặc cho các lễ kỷ niệm gia đình. ', '17x15x5', '1732778029557-15225-1.jpg', 'https://www.theflowers.vn/wp-content/uploads/2018/02/Socola-Godiva-Chocolate-Gold-Gift-Box-Ruy-Bang-hop-8-vien-100g.png', '0c88b1d6-5d43-46e4-bcf7-e2601e121633', 'Hộp quà sô cô la sữa, ruy băng vàng', '5fd17d29-aae2-11ef-9809-b46d832b8170', 'f67818a9-3a81-448d-bbdf-e42dc41702bf'),
	(100, '2024-11-27 15:17:28.085187', '2024-11-27 15:17:28.085187', 'Indulge in the divine flavor of our Fudgy Brownie Cookies, where gooey brownie centers meet chewy cookie edges. This recipe is a chocolate lover’s dream, offering the ultimate treat for those craving the perfect blend of brownie and cookie.', '10x10x10', '1732695447144-kitkat.jpg', 'https://pvmarthanoi.com.vn/wp-content/uploads/2023/05/kitkat_dau1_8cb2a45bd0f548f4a82bded882e118e7_grande.webp', '1026114e-201c-48d2-ad0b-8cd16c96edf5', 'Kit kat', '717587b8-77eb-4880-bffe-c9a7a6801dd6', '91d89950-b8c9-42dc-b61b-d7b41d615c1a'),
	(100, '2024-11-27 13:09:53.746254', '2024-11-27 13:09:53.746254', 'Socola hạt nút trắng nguyên chất 40%. Đóng gói 1kg, có bán chiết lẻ từ 100gr\n\nThành phần: Đường, bơ cacao, sữa bột, chất nhũ hóa lecithin đậu nành (E322), hương vani tự nhiên.', '10x10x10', '1732687793367-Puratos.jpg', 'https://bizweb.dktcdn.net/100/352/823/products/10352-19-03-2014-4917.jpg?v=1645858015500', '13adfb5f-84fb-4111-ba59-adb21417a629', 'Socola trắng hạt nút 40% Puratos 100gr', '717587b8-77eb-4880-bffe-c9a7a6801dd6', '90f7ca7d-303c-4b3b-a6d4-8cac2e98df42'),
	(100, '2024-11-28 14:27:04.537576', '2024-11-28 14:27:04.537576', 'Những viên ganache mềm và cứng — tất cả đều kết hợp với sô cô la Camino Verde, Ecuador 70% mềm mại của chúng tôi.', '17x15x5', '1732778823985-dandelion-chocolate-pearls-of-the-forest-bonbon-collection-34793450471564_1200x_crop_center.webp', 'https://bizweb.dktcdn.net/thumb/medium/100/514/431/products/keo-deo-vi-nho-orion-boom-jelly-goi-25g-clone-202403131459584968.webp?v=1716436992157', '1de9e6e3-1a7b-4c23-a52a-b3d9a6a33d68', 'Kẹo Bonbon Pearls of the Forest', '5fd17d29-aae2-11ef-9809-b46d832b8170', 'ab68cde2-513c-4e42-a237-2d2689f1399b'),
	(100, '2024-11-28 14:33:44.619034', '2024-11-28 14:33:44.619034', 'Sôcôla đen, sữa và trắng (bột ca cao, đường, bơ ca cao, bột sữa nguyên chất (SỮA), lecithin đậu nành (ĐẬU NÀNH), vani).', '17x15x5', '1732779224146-BB_25pc_Milk_Sympathy_350x.webp', 'https://domilk.vn/wp-content/uploads/2024/01/keo-sua-socola-domilk-long-thanh.webp', '29e29fc8-dd3a-4ac0-a475-2710c6d9cf59', 'Kẹo sữa sô cô la Sympathy', '5fd17d29-aae2-11ef-9809-b46d832b8170', '91d89950-b8c9-42dc-b61b-d7b41d615c1a'),
